/* IPv4地址中未使用部分的值 */
#define IPV4_NOT_USE_ADDULONG 0xffffffff

/* 租约的一半为T1 */
#define DHCPC_GET_T1_BY_LEASE(lease)  ((lease) >> 1)

/* 租约的7/8为T2. 非整除情况,向下取整. 
 * 第一部分:((lease) - ((lease) >> 3)). 不使用lease * 7 / 8的原因: lease * 7可能翻转。
 * 第二部分:(0 == (lease % 8 ) ? 0 : 1) 是对第一部分中(lease) >> 3)的误差修正。因为((lease) >> 3)
 * 在非整除情况下,会有部分的精度丢失。修正后为向下取整。
 */
#define DHCPC_GET_T2_BY_LEASE(lease)  ( ((lease) - ((lease) >> 3)) - (0 == (lease % 8 ) ? 0 : 1) )

