    ULONG       ulTEIDC;                     /*TEIDC*/  
    ULONG       ulPdpIndex;             /*用户索引*/
    ULONG       ulModId;                /*保留发起地址申请的模块ID，返回响应时使用*/
    ULONG       ulSrvIp;                /*交互的server IP*/
