    USHORT      usAlreadySendFlg;       /*是否已重发标志:0- 未重发1-已重发*/
    USHORT      usDhcpGroupIndex;       /*DHCP服务器组索引*/    
    USHORT      usDhcpStatus;           /*DHCP状态*/
    USHORT      usPoolIndex;            /*pool index*/    
    UCHAR       ucAddressType;          /*ipv4 ipv6*/
    UCHAR       ucUser;                      /*用户类型:V0:0;V1:1*/ 
